SELECT
  STATEFP
 ,COUNTYFP
 ,TRACTCE
 ,GEOID
 ,NAME
 ,NAMELSAD
 ,fixed AS Shape
FROM
  OPENJSON (@geojson, '$.features')
  WITH (
    STATEFP nvarchar(10) '$.properties.STATEFP',
    COUNTYFP nvarchar(10) '$.properties.COUNTYFP',
    TRACTCE nvarchar(10) '$.properties.TRACTCE',
    GEOID nvarchar(20) '$.properties.GEOID',
    NAME nvarchar(20) '$.properties.NAME',
    NAMELSAD nvarchar(50) '$.properties.NAMELSAD',
    [type] Varchar(64) '$.geometry.type',
    [coordinates] nvarchar (MAX) '$.geometry.coordinates' AS JSON
  ) AS GeoData
OUTER APPLY (
  SELECT STUFF ((SELECT CONCAT (',  ', JSON_VALUE (Value, '$[0]'), ' ', JSON_VALUE (Value, '$[1]'))
                 FROM OPENJSON (GeoData.coordinates, '$[0]')
                 ORDER BY CAST([Key] AS int)
                 FOR XML PATH ('')),1,3,'') [path]
  WHERE GeoData.[type] = 'Polygon'
) PolygonData
OUTER APPLY (
  SELECT
    STUFF ((SELECT CONCAT (',  ', polygon)
             FROM OPENJSON (GeoData.coordinates) AS Poly
             CROSS APPLY OPENJSON (Poly.Value) AS Shape
             CROSS APPLY (
               SELECT '(' + STUFF ((
                                     SELECT CONCAT (',  ', JSON_VALUE (Value, '$[0]'), ' ', JSON_VALUE (Value, '$[1]'))
                                     FROM OPENJSON (Shape.Value)
                                     ORDER BY CAST([Key] AS int)
                                     FOR XML PATH ('')),1,3,'') + ')' polygon
             ) Polygons
             FOR XML PATH ('')),1,3,'') multi
  WHERE GeoData.[type] = 'MultiPolygon'
) MultigonData
CROSS APPLY (
  SELECT CONCAT (UPPER (GeoData.[type]), '((', COALESCE (PolygonData.path, MultigonData.multi), '))') WKT
) shapeDef
OUTER APPLY (
  SELECT geography::STGeomFromText (WKT, 4326).MakeValid () /*.ReorientObject()*/ AS geom
) geography
OUTER APPLY (
  SELECT CASE
           WHEN geom.EnvelopeAngle () > 90 THEN geom.ReorientObject ()
           ELSE geom
         END AS fixed
) fixes;